@theyouthassembly, this is unacceptable. participation in an activity should not be contingent on whether or not one decides to have their imagine captured. people should not be forced into doing anything and even if they decide to at first, they should be allowed to withdraw #consent at anytime. 
this goes against people's right to bodily autonomy. we should use every occasion to highlight how important consent is and why it should not be forced.

