text:
i’m with tamika. no matter how unpopular a position might be, we have to be able to perceive and hold a spot in our thinking that focuses first and foremost on truth. i was having a conversation with a jewish white guy and in his mind,because he was jewish, i was not supposed to mention the fact that black people have faced by far the worst treatment of anybody else on the planet. as bad as hitler was, he pales in comparison to columbus, the catholic church, protestants, and what europeans and americans have done to black people at large. because of this and a countless number of other reasons, my sympathies are black.

@the_new_a_x

